import './homepage.css';


function Homepage() {
  return (
    <section id='header'>
      <a href="#" ><img src="/logoimagem.png" class="imglogo1"></img></a>

      <div>
        <ul class='navbar'>
          <li><a href="" >Home </a></li>
          <li><a href="" >Serviços </a></li>
          <li><a href="" >Sobre </a></li>
          <li><a href="" >Contato </a></li>
          <li><a href="" >Catálogo </a></li>
          </ul>
      </div>


    </section>
  );
}

export default Homepage;
